materials.vertexShader:
//header-begin
uniform float iTime;
uniform vec2 iResolution;
uniform sampler2D iDepthTexture;
uniform sampler2D iSceneTexture;
uniform float iCameraNear;
uniform float iCameraFar;
uniform sampler2D iTexture0;
uniform sampler2D iTexture1;
uniform sampler2D iPass0;
uniform sampler2D iPass1;
//header-end
varying vec3 fNormal;
varying vec3 fPosition;
varying vec2 fUV;
varying vec3 fChannelFactor;
varying float fLoopduration;

#define PI 3.14

void main()
{
    vec3 dpos = position;
    vec4 dcolor = texture2D(iTexture0, uv);

    fLoopduration = 1.656;

    float r = sin((iTime / fLoopduration) * (2.0 * PI)) * 0.5 + 0.25;
    float g = sin((iTime / fLoopduration + 0.33333333) * 2.0 * PI) * 0.5 + 0.25;
    float b = sin((iTime / fLoopduration + 0.66666667) * 2.0 * PI) * 0.5 + 0.25;
    float correction = 1.0 / (r + g + b);
    r *= correction;
    g *= correction;
    b *= correction;

    fChannelFactor = vec3(r,g,b);
    float d = (dcolor.r*fChannelFactor.r + dcolor.g*fChannelFactor.g + dcolor.b*fChannelFactor.b);
    dpos.xyz += normal * d * 0.748;

    fNormal = normalize(normalMatrix * normal);
    vec4 pos = modelViewMatrix * vec4(dpos, 1.0);
    fPosition = pos.xyz;
    fUV = uv;

    gl_Position = projectionMatrix * pos;
}

materials.fragmentShader:
//header-begin
uniform float iTime;
uniform vec2 iResolution;
uniform sampler2D iDepthTexture;
uniform sampler2D iSceneTexture;
uniform float iCameraNear;
uniform float iCameraFar;
uniform sampler2D iTexture0;
uniform sampler2D iTexture1;
uniform sampler2D iPass0;
uniform sampler2D iPass1;
//header-end
varying vec3 fPosition;
varying vec3 fNormal;
varying vec2 fUV;
varying vec3 fChannelFactor;
varying float fLoopduration;

#define PI 3.14
void main(){
    vec4 dcolor = texture2D(iTexture0, fUV);    
    float r = sin((iTime / fLoopduration * 0.5) * (2.0 * PI)) * 0.5 + 0.5;    
    vec2 range = vec2(0.0,1.0);    
    float d = (dcolor.r*fChannelFactor.r + dcolor.g*fChannelFactor.g + dcolor.b*fChannelFactor.b) * (range.y - range.x) + range.x;        
    float clipRange = 1.0;
    if (d > clipRange){
        discard;    
    }    
    vec4 c = texture2D(iTexture1, vec2(d,0.5));
    gl_FragColor = c;
}

